import { AllDOGS } from "./action-types";
const initialState = {
    allDogs: [],
    copydogs:[],
    temperamento:[]
}

const reducer = (state= initialState, {type, payload})=>{
   // console.log("entro al reducer la informacion" + payload);
    switch( type ){
        case AllDOGS:
            return{
                ...state, allDogs:payload
            }
        default:
            return {...state}
    }




}

export default reducer;
